import './App.css';
import { makeStyles } from '@material-ui/core'
import Header from './header'
import NestedGrid from './nestedGrid'
import { Grid }  from '@material-ui/core'
import 'fontsource-roboto';


const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    marginTop: 10
  },
}));


function App() {
  const classes=useStyles()
  return (
    <div className="App">
      <Header></Header>
      <Grid container xs={12} direction ="column" alignItems="Center" classes={classes.root} paddingTop={2}>
        <Grid item xs={9}>
          <NestedGrid></NestedGrid>
        </Grid>
        <Grid item xs={3}>

        </Grid>
      </Grid> 


    </div>
  );
}

export default App;
